column8:
ポーランドから ユニークでかわいい<BR>
木製のおもちゃが入荷しました。<BR>
<BR>
柄を持ってくるくると回すと、<BR>
4羽のニワトリさんたちが コツコツコツ☆と、<BR>
中央部分に描かれた朝ごはんをつつきます。<BR><BR>
単純な動きだけど、なんだかユニークでカワイイ♪<BR>
お子様のおもちゃにはもちろん、<BR>
おもしろい雑貨好きの大人の皆様にもいかがでしょうか？<BR><BR>
サイズ：本体直径約13cm、柄の部分の長さ約7cm<BR>

ポーランド製<BR>
<FONT COLOR="ff6600">※彩色の際の絵の具汚れや接着剤のはみ出た部分、持ち手・玉にヒビやへこみ等がある場合がございますが、良品として出荷されております。<BR>
手作り品の持ち味としてご理解頂いた上でお買い求めいただきますようお願いいたします。</FONT><BR><BR>

