ポーランドの民族衣装をまとった、<BR>
かわいいガラス製のオーナメント。<BR>
クリスマスツリーが賑やかになりそうな<BR>
楽しい飾りです。<BR><BR>

吹きガラスに手で彩色を施した、<BR>
Bombki（ボンブキ）と呼ばれる工芸品です。<BR>
暖かみのあるハンドメイドで、細部まで丁寧に仕上げられています。<BR><BR>

ポーランドの４つの地方の男の子と女の子、合計8種類。<BR>
こちらのページはウォヴィス地方の男の子です。<BR>
マットな黒の衣装がカッコいいですね♪<BR><BR>
<FONT COLOR="ff6600">※男の子のオーナメント以外の物は商品に含まれません。</FONT><BR>
<FONT COLOR="ff6600">※こちらの商品はガラス製で大変こわれやすいので、<BR>
お取り扱いにはご注意ください。</FONT><BR><BR>
高さ約15.5cm（環金具を含む)<BR>
幅最大で約5.2cm 厚み最大で約3.5cm<BR><BR>




